function Cards(){

    return(
        <>
            <div className="cards">
            <div className="card">
            <img src="https://resizing.flixster.com/xAhAb90rr97I6Cs-hudVYPabu94=/206x305/v2/https://flxt.tmsimg.com/assets/p21253787_b_v13_aa.jpg" alt="season profile photo"></img>
            <div className="card-info">
                <span className="card-category"></span>
            <h3 className="CardTitle"></h3>
            <a href="https://m4ufree.fun/watch-theendgame-264607-tvshow-online-free-m4ufree.html" target="_blank">
                <button> Watch Now</button>
            </a>
        
            </div>
            </div>
        
            </div>
        </>

    );
}

ReactDOM.render(
    <Cards/>
    ,
    document.getElementById("root")
)
